import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import{FormsModule,ReactiveFormsModule} from '@angular/forms';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { InitalizeComponent } from './initalize/initalize.component';
import{HomepageComponent} from './homepage/homepage.component';
import{AdminComponent} from './admin/admin.component';
import{LoginComponent} from './login/login.component';
import { SignupComponent } from './signup/signup.component';
import { LandingComponent } from './landing/landing.component';
import{WishlistComponent} from './wishlist/wishlist.component';
import{CartComponent} from './cart/cart.component';

import { HttpClientModule } from '@angular/common/http';

import { UserService } from './services/user.service';
import { ProductService } from './services/product.service';
import { CartService } from './services/cart.services';
import { WishlistService } from './services/wishlist.services';

@NgModule({
  declarations: [
    AppComponent, HomepageComponent, LoginComponent, InitalizeComponent, SignupComponent, LandingComponent,
    WishlistComponent,CartComponent,AdminComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,HttpClientModule,FormsModule,ReactiveFormsModule
  ],
  providers: [UserService,ProductService,CartService,WishlistService],
  bootstrap: [AppComponent]
})
export class AppModule { }
